import React from 'react';
import ReactDOM from 'react-dom';
import App from './pages/App';

const chartOptions = {
    responsive: true,
    scales: {
        x: {
            type: 'timeseries', // <-- fix here
            time: {
                unit: 'month',
            },
        },
        y: {
            beginAtZero: true,
        },
    },
};

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
